import { styled } from 'styled-components';

export const ListUl = styled.ul`
  height: 200px;
  overflow: auto;
  margin-top: 20px;
  padding: 5px;
`;

export const ListDiv = styled.div`
display: flex;
flex-direction: column;
gap: 25px;
align-items: center;


`
